INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (7, -285.0, "ラビリスタ", "2025/01/31 12:00:00", -6.0, 1020101, 101, "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 5.18, 3, 61, 10201, 133701);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "クリスティーナ", "2025/01/31 12:00:00", -2.0, 1020102, 201, "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 8.77, 1, 61, 10201, 133901);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, -285.0, "ネネカ", "2025/01/31 12:00:00", 0.0, 1020103, 301, "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 15.5, 6, 61, 10201, 133801);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (5, -285.0, "ランファ", "2025/02/28 12:00:00", 0.0, 1020201, 101, "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 9.061, 2, 61, 10202, 134301);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "チカ", "2025/02/28 12:00:00", 0.0, 1020202, 201, "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 7.699, 1, 61, 10202, 134401);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "アオイ", "2025/03/31 12:00:00", 0.0, 1020301, 101, "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 8.595, 1, 61, 10203, 134601);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "クローチェ", "2025/03/31 12:00:00", 0.0, 1020302, 201, "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 7.758, 1, 61, 10203, 134501);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (6, -285.0, "ルイズマリー", "2025/04/30 12:00:00", 0.0, 1020401, 101, "2030/01/01 14:59:59", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 7.0, 2, 61, 10204, 132302);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "イロハ", "2025/04/30 12:00:00", 0.0, 1020402, 201, "2030/01/01 14:59:59", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 7.904, 1, 61, 10204, 132402);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "ソノ", "2025/04/30 12:00:00", 0.0, 1020403, 301, "2030/01/01 14:59:59", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 8.487, 4, 61, 10204, 132502);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "カノン", "2025/05/31 12:00:00", 0.0, 1020502, 101, "2030/01/01 14:59:59", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 8.763, 1, 61, 10205, 134901);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (3, -285.0, "ツムギ", "2025/05/31 12:00:00", 0.0, 1020503, 201, "2030/01/01 14:59:59", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 6.417, 1, 61, 10205, 134801);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (7, -285.0, "エリス", "2025/06/30 12:00:00", 0.0, 1020601, 101, "2030/01/01 14:59:59", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 10.335, 3, 61, 10206, 135001);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (4, -285.0, "シェフィ", "2025/06/30 12:00:00", 0.0, 1020602, 201, "2030/01/01 14:59:59", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 6.281, 2, 61, 10206, 135101);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, -285.0, "プレシア", "2025/06/30 12:00:00", 0.0, 1020603, 301, "2030/01/01 14:59:59", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 12.244, 1, 61, 10206, 135201);
